(92, '', '', '', '', '', '', '', 'em-oi-sao-gia-ben-em-bao-dat-hon-may-cho-khac-nhieu-vay-em', '', '<p>D anh i, bn em l Xng sn xut trc tip nn gi bn bo st lm ri , em khng bit my ch khc bo anh gi ntn v cht lng h lm cho anh ra sao. Nhng em dm m bo vi anh 100% l hp bn em lm ra 100 ci nh 1 hng u p. Nu bn anh pht hin ra c hp no xu hoc mp mo anh tr li bn em, em hon li tin cho anh hoc lm li s hp cn thiu cho anh .&nbsp;</p>\r\n', '', '', '', 11, 1, 1476761305, 0, '', '', '', '', '', '', 'Em i, sao gi bn em bo t hn my ch khc nhiu vy em?', '', 0, 'Em i, sao gi bn em bo t hn my ch khc nhiu vy em?', '', '', 'xu-huong', 1),
(93, '', '', '', '', '', '', '', 'em-oi-anh-muon-xem-1-so-mau-hop-dung-my-pham-em-cho-ben-kinh-doanh-qua-gap-anh-tu-van-cho-anh-ve-chat-lieu-duoc-khong', '', '<p>D c nha anh, anh cho em xin st di ng ca anh v a ch c th , em s mang 1 s mu bn em  lm cho khch ri qua gp anh nh. Em c th qua gi no gp anh  tin cho anh nht .&nbsp;</p>\r\n', '', '', '', 12, 1, 1476761340, 0, '', '', '', '', '', '', 'Em i anh mun xem 1 s mu hp ng m phm em cho bn kinh doanh qua gp anh t vn cho anh v cht liu c khng?', '', 0, 'Em i anh mun xem 1 s mu hp ng m phm em cho bn kinh doanh qua gp anh t vn cho anh v cht liu c khng?', '', '', 'xu-huong', 1),
(94, '', '', '', '', '', '', '', 'em-oi-chi-o-ngoai-hn-neu-muon-dat-hang-thi-phai-lam-sao-em', '', '<p>D ch i, nu ch mun t hng bn cng ty &nbsp;em trc tin ch gi em thng tin c th yu cu bo gi, nu ch c hnh mu hp th ch gi em lun nh. Bn em bo gi xong nu c ok th t hng v thanh ton cho bn em trc 50% n hng tin t cc nh. Bn em h tr vn chuyn min ph ti chnh xe ch yu cu cn ph vn chuyn t SG v HN ch t thanh ton vi ch xe gip em nh.</p>\r\n', '', '', '', 13, 1, 1476761375, 0, '', '', '', '', '', '', 'Em i, ch  ngoi HN nu mun t hng th phi lm sao em?', '', 0, 'Em i, ch  ngoi HN nu mun t hng th phi lm sao em?', '', '', 'xu-huong', 1),
(12, 'My git khng bm nc vo v cch s l', '', '', '', 'My git khng bm nc vo v cch s l', '', '', 'may-giat-khong-bom-nuoc-vao-va-cach-su-ly', 'My git khng bm nc vo khi bn bm Start c nhiu nguyn nhn nh : ngun nc nh qun m van nc, nc qu yu, li lc nc b bi bn, dy dn nc b gp khc, bm nc b hng, my git b hng bo mch iu khin my .....', '<h4>&nbsp;</h4>\r\n\r\n<ul>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Cng tt cm bin lc nc b hng, trong trng hp ny ch cn sa cha hoc thay th l my git c th hot ng tr li</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">p lc nc khng  mnh, nhiu trng hp khch hng&nbsp;bn nc v my git cng chung trn sn thng nn p lc nc khng  mnh   nc cho my git hot ng. Khc phc bng cch s dng my git c bm ph hoc t my  ni tt hn.</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Kim tra li van cp nc xem  c m hay cha, van nc b r r nn ai   kha li.</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Kim tra ngun nc cp xem c phi mt nc hay khng.</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Kim tra, v sinh sch li lc nc u vo my git</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Dy ai b gy hoc lng cng ngn my git vt hoc x. Bn hy th ko my git ra khi tng, s dng tuc n vt  tho tm lng my. S dng n pin  kim tra trc quan xem dy ai c b lng hay gy khng. </span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Hy thay bt k dy ai no b lng hay gy. Thay th dy ai my git l kh nn tt nht bn hy gi cho th sa my git chuyn nghip.</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Mt kh nng khc lm my git khng x vt l do bm.</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Khi tm lng my cn ang m, bn hy kim tra bm bng in k  m bo bm c in vo. </span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Nu my git c in ri, bn khi ng my v nghe xem c phi bm vn chy m nc khng thot khng. </span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">C kh nng bn cn tho bm v lm sch n hoc thay th bm mi. </span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Mt khi  thay th bm, bt my git hot ng  xc nh my c x vt c khng.</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Hoc bn m ci van cp nc ca ra ,n l 1 ci van t ,dng 1 ci nam chm in  tc ng vo 1 ci mng bng cao su , cho ng ngt .Xem xt th n hay b nght ti ch  hay khng. Nu  lm ri m khng c th hy kim tra li ci cm cp in cho nam chm hot ng t ch board iu khin ra n van. nu khng c th thay van mi.</span></span></p>\r\n	</li>\r\n	<li>\r\n	<p><span style="font-family:arial,helvetica,sans-serif"><span style="font-size:14px">Trong trng hp tt c cc cch trn u khng c hiu qu th bn c th ngh n nguyn nhn xu nht l hng board khin. Hy lin h vi chng ti  nhn t vn sa cha.</span></span></p>\r\n	</li>\r\n</ul>\r\n', '', '01813868.jpg', '', 1, 1, 1447037500, 1466650719, '', '', '', '', '', '', 'My git khng bm nc vo v cch s l', '', 20, '', '', '', 'dich-vu', 1),
