(89, '', '', '', '', '', '', '', 'em-oi-ben-em-co-lam-loai-hop-nao-co-10k-1-hop-khong', '', '<p>D bn em c loi hp gp xp gi ok nht nhng ch ng c nhng sn phm v d nh Khn, o,  nh nh thi  ch khng ng c nhng sn phn ln v nng . Ch t s lng 2.000  5.000 hp th mi c gi  nha ch.</p>\r\n', '', '', '', 8, 1, 1476761187, 0, '', '', '', '', '', '', 'Em i, bn em c lm loi hp no c 10k 1 hp khng?', '', 0, 'Em i, bn em c lm loi hp no c 10k 1 hp khng?', '', '', 'xu-huong', 1),
(90, '', '', '', '', '', '', '', 'em-oi-anh-muon-dat-hop-cao-cap-em-bao-gia-cho-anh-nhe', '', '<p>D anh i, anh cho em bit anh t hp ng sn phm g bn trng   em t vn loi hp ph hp vi nhu cu ca anh nh. Em gi km anh trang wed bn cng ty em  anh tham kho mu nh.</p>\r\n', '', '', '', 9, 1, 1476761226, 0, '', '', '', '', '', '', 'Em i, anh mun t hp cao cp em bo gi cho anh nh. ', '', 0, 'Em i, anh mun t hp cao cp em bo gi cho anh nh. ', '', '', 'xu-huong', 1),
(91, '', '', '', '', '', '', '', 'em-oi-anh-dang-can-gap-100-hop-qua-de-lam-su-kien-hop-nap-day-don-gian-thoi-em-nap-ep-kim-logo-ten-cong-ty-anh-la-ok-anh-can-gap-trong-vong-3-ngay-ben-em-lam-kip-khong', '', '<p>D anh i, trong vng 3 ngy bn em c th lm xong 100 hp cho anh, nhng bn e s tnh thm 10% trn tng &nbsp;n hng ph giao hng gp nha anh. V n hng 100 hp bnh thng bn em nhn lm trong vng 7 ngy .</p>\r\n', '', '', '', 10, 1, 1476761270, 0, '', '', '', '', '', '', 'Em i, anh ang cn gp 100 hp qu  lm s kin, hp np y n gin thi em, np p kim logo tn cng ty anh l ok. Anh cn gp trong vng 3 ngy, bn em lm kp khng?', '', 0, 'Em i, anh ang cn gp 100 hp qu  lm s kin, hp np y n gin thi em, np p kim logo tn cng ty anh l ok. Anh cn gp trong vng 3 ngy, bn em lm kp khng?', '', '', 'xu-huong', 1),
(83, '', '', '', '', '', '', '', 'chi-oi-cong-ty-em-dang-co-nhu-cau-dat-so-luong-lon-hop-trai-tim-chi-bao-gia-giup-em-voi-nhe', '', '<p>Cho bn, bn mnh khng nhn lm hp tri tim nh v hp tri tim phi dn 100% th cng ht bn mnh khng dn bng my c thi gian lm hng rt lu nn mnh k nhn nh. Bn c th i qua mu hp hnh vung hoc ch nht c khng n?</p>\r\n', '', '', '', 2, 1, 1476760679, 0, '', '', '', '', '', '', 'Ch i, Cng ty em ang c nhu cu t s lng ln hp tri tim ch bo gi gip em vi nh?', '', 0, 'Ch i, Cng ty em ang c nhu cu t s lng ln hp tri tim ch bo gi gip em vi nh?', '', '', 'xu-huong', 1),
