(35, '', '', '', '', '', '', '', 'quy-dinh-bao-hanh-mien-phi', 'Quy nh ny c p dng i cc sn phm My git, T lnh, My iu ha...my lnh \r\n\r\nMua ti hng cng ty in Lnh HNG PHAT c bo hnh min ph c mt chm nht 24h t khi thng bo \r\n', '<h4>&nbsp;</h4>\r\n\r\n<p>MC 1: IU KIN BO HNH MIN PH</p>\r\n\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sn phm cn trong thi hn bo hnh v c ng k bo hnh.</p>\r\n\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sn phm b h do li k thut ca nh sn xut.</p>\r\n\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Phiu bo hnh phi c xut trnh khi c yu cu bo hnh min ph.&nbsp;</p>\r\n\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Phiu bo hnh phi cn nguyn vn, phi th hin r tn khch hng v ngy mua, khng chp ni, khng b ty xa.</p>\r\n\r\n<p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Trong thi hn bo hnh .khi sn phm c trc trc hay s c, khch hng vui lng lin lc vi trm bo hnh gn nht  c t vn bo hnh min ph ti nh.</p>\r\n\r\n<p>LU : Trong trng hp cn chuyn sn phm n trm bo hnh  sa cha th k thut ca trm bo hnh s l ngi quyt nh v trong trng hp ny khch hng phi tr chi ph vn chuyn sn phm t nh n trm bo hnh v ngc li.</p>\r\n\r\n<p>MC 2: IU KIN KHNG C BO HNH MIN PH</p>\r\n\r\n<p>1.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sn phm  ht hn bo hnh.</p>\r\n\r\n<p>2.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Khng c phiu bo hnh hay chng t ha n lin quan n sn phm.</p>\r\n\r\n<p>3.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sn phm b h hng do thin tai, l lt, st nh, ha hon hay do vn chuyn lm nt, mp, b, try xc.</p>\r\n\r\n<p>4.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sn phm h hng do s dng khng ng theo hng dn, do lp t khng ng k thut, do ngun in khng ng, khng n nh v in th hoc tn s.</p>\r\n\r\n<p>5.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sn phm b r st,  bn do n mn hay do cht lng  vo</p>\r\n\r\n<p>6.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sn phm c du hiu  tho lp, sa cha thay th linh kin  nhng ni khc ngoi cc trm bo hnh.</p>\r\n\r\n<p>8.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cc ph kin km theo sn phm khng phi l linh kin bo hnh. V d: tng phm khuyn mi, mt s ph kin km theo khc nh b lc s vi, li kh mi, pin v.v</p>\r\n\r\n<p>9.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Cc trng hp yu cu v v sinh sn phm, bo tr sn phm khng nm trong cc hng mc bo hnh.</p>\r\n', '', '13955733.jpg', '', 1, 1, 1453999536, 1467283976, '', '', '', '', '', '', 'Quy nh bo hnh min ph ', '', 14, 'Quy nh bo hnh min ph', 'Quy nh bo hnh min ph', 'Quy nh bo hnh min ph', 'he-thong', 1),
