(57, 'bo hnh', '', 'bo hnh', '', 'trong thi gian s dng iu ha m trn v cc loi khc nu gp bt k trc trc no hoc li do ngi s dng, khch hng c th lin lc trc tip vi Trung tm bo hnh ca Hng hoc Trung tm Chm sc khch hng ca cng ty Hng Pht  c tr gip. \r\n\r\nI/ Bo hnh:\r\n\r\nBo hnh sn phm l: khc phc nhng li hng hc, s c k thut xy ra do li ca nh sn xut\r\n\r\nII/ Quy nh v bo hnh:\r\n\r\n- Sn phm c bo hnh min ph nu sn phm  cn thi hn bo hnh c tnh k t ngy giao hng.\r\n\r\n- Thi hn bo hnh c ghi trn Phiu Bo hnh v theo quy nh ca tng hng sn xut i vi tt c cc s c v mt k thut.\r\n\r\n- C phiu bo hnh v tem bo hnh ca cng ty trn sn phm.\r\n\r\nIII/ Nhng trng hp khng c bo hnh:\r\n\r\n- Sn phm  qu thi hn bo hnh ghi trn phiu hoc mt Phiu Bo hnh.\r\n\r\n- Tem nim phong bo hnh b rch, v, b dn  hoc b sa i.\r\n\r\n- Phiu bo hnh khng ghi r s Serial v ngy mua hng.\r\n\r\n- S my trn sn phm khng xc nh c hoc sai so', '', '', 'chinh-sach-bao-hanh', 'BO HNH MIN PH TRN SN PHM CA CHNG TI', '<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">trong thi gian s dng&nbsp;<a href="http://hopphat.com/dieu-hoa-am-tran-cassette.html" style="color: rgb(51, 51, 51);">iu ha m trn</a>&nbsp;v cc loi khc nu gp bt k trc trc no hoc li do ngi s dng, khch hng c th lin lc trc tip vi Trung tm bo hnh ca Hng hoc Trung tm Chm sc khch hng ca cng ty Hng&nbsp;Pht  c tr gip.&nbsp;</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;"><strong>I/ Bo hnh:</strong></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">Bo hnh sn phm l: khc phc nhng li hng hc, s c k thut xy ra do li ca nh sn xut</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;"><strong>II/ Quy nh v bo hnh:</strong></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- Sn phm c bo hnh min ph nu sn phm  cn thi hn bo hnh c tnh k t ngy giao hng.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- Thi hn bo hnh c ghi trn Phiu Bo hnh v theo quy nh ca tng hng sn xut i vi tt c cc s c v mt k thut.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- C phiu bo hnh v tem bo hnh ca cng ty trn sn phm.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;"><strong>III/ Nhng trng hp khng c bo hnh:</strong></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- Sn phm  qu thi hn bo hnh ghi trn phiu hoc mt Phiu Bo hnh.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- Tem nim phong bo hnh b rch, v, b dn  hoc b sa i.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- Phiu bo hnh khng ghi r s Serial v ngy mua hng.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- S my trn sn phm khng xc nh c hoc sai so vi s my c ghi trn phiu bo hnh.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- Sn phm b h hng do tc ng c hc lm ri, v, va p, try xc, mp mo, m t, hoen r, chy nc hoc do ha hon, thin tai gy nn.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- Sn phm c du hiu h hng do chut b hoc cn trng xm nhp.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- S dng khng ng sch hng dn, s dng sai in p quy nh.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- Cc phn mm cung cp min ph km theo my.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- T  tho d, sa cha bi cc c nhn hoc k thut vin khng c s y quyn ca Hp Pht</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">- Cha thanh ton y  theo quy nh</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;"><strong>IV/ Bo tr:</strong></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">Bo tr, bo dng bao gm: Bo dng sn phm nh k, np ga, ra li lc, qut bi bn trong, lau chi sn phm, dit virus, ci t cc chng trnh, sa cha nhng hng hc nh c th sa c (khng bao gm thay th thit b).Thi gian bo tr bo dng ty thuc vo s tha thun gia Hp Pht v khch hng.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;"><strong>CAM KT BO HNH V DCH V HU MI CA CNG TY HNG PHT</strong></p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">1-&nbsp;&nbsp;&nbsp;Cam kt bo hnh</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;"><strong>i vi iu ha Daikin:&nbsp;</strong>Bo hnh 01 nm vi ton b thit b, ring my nn bo hnh 4 nm.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong>i vi iu ha khc:&nbsp;</strong>Bo hnh theo quy nh ring ca hng sn xut nhng khng di 01 nm bo hnh.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">2-&nbsp;&nbsp;&nbsp;Min ph mt s dch v theo cc t khuyn mi ca nh sn xut (nu c) trong qu trnh s dng thit b.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">&nbsp;3-&nbsp;&nbsp;&nbsp;Trong thi gian bo hnh, ngay sau khi nhn c thng bo ca bn mua v h hng ca thit b nu khng phi do li ca ngi s dng, chng ti s khn trng tin hnh thay th hoc sa cha cc thit b h hng bng thit b mi. Mi chi ph lin quan n thay th s do cng ty Hng&nbsp;Pht chu.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">&nbsp;4-&nbsp;&nbsp;&nbsp;Trong vng 24h k t lc nhn c thng bo ca bn mi thu, nhn vin k thut ca Hp Pht s c mt  x l i vi nhng cng trnh trong ni thnh tphcm&nbsp;v trong vng 48h i vi cng trnh ngoi phm vi tphcm</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">&nbsp;5-&nbsp;&nbsp;&nbsp;Trong trng hp c s c ca thit b do li ca ngi s dng, chng ti vn tin hnh sa cha hoc thay th v min ph tin cng dch v. Phn thit b thay th (nu c) s tnh vi bn mua theo gi th trng.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">&nbsp;6-&nbsp;&nbsp;&nbsp;Cng ty Hng&nbsp;Pht lun duy tr trong kho ca mnh mt s lng an ton v sn sng cung cp nhanh chng cc thit b v ph tng thay th chnh hiu  phc v bo hnh v dch v hu mi cho my iu ha nh:</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">-&nbsp;&nbsp;Compressor, motor, mch in t v nhiu ph tng khc phc v h thng</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">-&nbsp;&nbsp;Cc loi vt t chuyn dng nh gas, nht lnh.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">-&nbsp;&nbsp;Thit b in, cc ph kin trong t in</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">-&nbsp;&nbsp;Cc vt t thng dng khc</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">&nbsp;7-&nbsp;&nbsp;&nbsp;Cng ty Hng&nbsp;Pht c quan h i tc vi cc hng cung cp cc sn phm my lnh  c th p ng nhanh chng nhu cu s dng ca khch hng</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">&nbsp;8-&nbsp;&nbsp;&nbsp;Cng ty Hng&nbsp;Pht c i ng k s, k thut bo tr sa cha c tuyn chn v o to c h thng, c kinh nghim nhiu nm trong lnh vc in lnh, c s h tr k thut t cc nh cung cp trn th gii nh Daikin, Mitsubishi, c trang b y  cc thit b o kim chuyn dng.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">&nbsp;9-&nbsp;&nbsp;&nbsp;B phn bo tr c h tr bi cc xng gia cng c kh, xng ch to t in, xng lp rp thit b lnh, phng k thut v c th gii quyt mi vn  sa cha ln, i tu h thng.</p>\r\n\r\n<p style="color: rgb(34, 34, 34); font-family: Arial; font-size: 14px; line-height: normal;">&nbsp;10-&nbsp;Cng ty Hng&nbsp;Pht c th&nbsp; t vn gip khch hng xy dng lch bo tr ph hp vi cc c th ca cng trnh. Ngoi ra c th cung cp cc hp ng dch v bo tr ngn nga hoc bao trn gi, vi mc tiu gim chi ph vn hnh tng cng cho khch hng, duy tr hot ng n nh hiu qu, ko di tui th ca thit b.</p>\r\n', '', '', '', 1, 1, 1465880003, 1467014207, '', '', '', '', '', '', 'Chnh sch bo hnh', '', 14, 'BO HNH', 'BO HNH', 'BO HNH', 'chinh-sach', 1),
