(71, '', '', '', '', '', '', '', 'em-oi-ben-em-co-lam-hop-bang-go-khong', '', '<p><span style="font-family:times new roman,serif;"><span style="font-size:13.0pt;">Em i, bn em c lm hp bng g khng?</span></span></p>\r\n\r\n<p><span style="font-family:times new roman,serif;"><span style="font-size:13.0pt;">D khng anh i, bn em ch lm hp cht liu bng giy thi . Nhng bn em c loi giy m thut gi g anh c mun xem&nbsp; hp bn em lm cht liu bng giy m dn giy gi g khng em gi hnh cho anh tham kho .</span></span>&nbsp;</p>\r\n', '', '', '', 1, 1, 1467361381, 1476760731, '', '', '', '', '', '', 'Em i, bn em c lm hp bng g khng?', '', 37, 'Em i, bn em c lm hp bng g khng?', '', '', 'xu-huong', 1),
(84, '', '', '', '', '', '', '', 'em-oi-ben-chi-dang-co-nhu-cau-dat-khoang-20-hop-dung-qua-tang-sep-ben-em-co-nhan-lam-khong', '', '<p>D em cho ch, Bnh thng bn em ch nhn n hng ti thiu 50 hp tr ln thi , nhng ch c th cho em bit ch ng sn phm g bn trong v kch thc bao nhiu khng ? Bn em c 1 s khun c sn nu gn vi yu cu ca ch th bn em s lm hng cho ch lun .</p>\r\n', '', '', '', 3, 1, 1476760796, 0, '', '', '', '', '', '', 'Em i, bn ch ang c nhu cu t khong 20 hp ng qu tng Sp bn em c nhn lm khng?', '', 0, 'Em i, bn ch ang c nhu cu t khong 20 hp ng qu tng Sp bn em c nhn lm khng?', '', '', 'xu-huong', 1),
(85, '', '', '', '', '', '', '', 'em-oi-ben-cong-ty-anh-dang-co-nhu-cau-dat-1000-hop-y-hinh-anh-gui-em-bao-gia-giup-anh-nhe', '', '<p>D em cho anh , anh mun bo gi th anh gi li em thng tin kch thc c th nh. Kch thc: di*rng*cao? Trn np hp anh c mun in n g khng ? Trong hp anh c mun lt vi hay b xp khng ? Anh vui lng  li cho em xin st di ng ca anh,  tin lin lc anh nh.</p>\r\n', '', '', '', 4, 1, 1476760874, 0, '', '', '', '', '', '', 'Em i, bn cng ty anh ang c nhu cu t 1.000 hp y hnh anh gi, em bo gi gip anh nh.', '', 0, 'Em i, bn cng ty anh ang c nhu cu t 1.000 hp y hnh anh gi, em bo gi gip anh nh.', '', '', 'xu-huong', 1),
(86, '', '', '', '', '', '', '', 'gia-si-hop-qua-nhu-the-nao-ha-shop', '', '<p>Cho bn, bn mnh l cng ty sn xut trc tip lun khng phi shop nn khong c nhiu mu sn n, bn mun t hp th cho mnh bit thng tin kch thc + s lng c th nh mnh s bo gi bn n. Bn gi lun hp mu bn mun t l hp ntn  mnh tnh gi d hn nha.</p>\r\n', '', '', '', 5, 1, 1476760911, 0, '', '', '', '', '', '', 'Gi s hp qu nh th no h shop?', '', 0, 'Gi s hp qu nh th no h shop?', '', '', 'xu-huong', 1),
(82, '', '', '', '', '', '', '', 'cach-thuc-dat-hang-ben-cong-ty-sac-hoa', 'Cch thc t hng bn cng ty sc hoa', '<ul>\r\n	<li><span style="font-family:times new roman,serif;"><span style="font-size:13.0pt;">Khch n cng ty mun t hp qu tng nhng cha bit t kin thc g v qui cch hp qu cng nh mu hp nh th no l p.Em s ni chuyn t vn  nm bt c nhu cu v ngn sch ca khch ntn  t vn loi hp ph hp vi khch nht.</span></span></li>\r\n	<li><span style="font-family:times new roman,serif;"><span style="font-size:13.0pt;">Sau khi khch  ok mu hp v qui cch em s tin hnh bo gi v gi km 1 file thit k 3D cho khch xem  khch hnh dung c ci hp mnh t nhn nh th no.</span></span></li>\r\n	<li><span style="font-family:times new roman,serif;"><span style="font-size:13.0pt;">Nu khch ok bo gi v thit k khng c g thc mc na th em s tin hnh cho khch chn li mu giy, mu p kim  cht li ln cui.</span></span></li>\r\n	<li><span style="font-family:times new roman,serif;"><span style="font-size:13.0pt;">Ni s qua v th tc t hng bn cng ty: Nhn thanh ton 50% tin t cc n hng, v tha thun thi giao hng vi khch, nu a ch&nbsp; giao hng  cc qun 1,3,5, 10, Tn Bnh, Ph Nhun th min ph giao hng cc Qun cn li ch h tr ( 200.000VN p dng vi n hng trn 10 triu ). Lu : n hng di 10 triu m ng bao to, k vn chuyn c bng xe my th bn Cng ty khng h tr giao hng. </span></span></li>\r\n	<li><span style="font-family:times new roman,serif;"><span style="font-size:13.0pt;">Khch ok ht iu khon bn Cng ty th tin hng lm n t hng hoc lm hp ng nu khch yu cu. Mang n t hng qua cho khch k + thu tin.&nbsp;</span></span></li>\r\n</ul>\r\n', '', '28670703.jpg', '', 1, 1, 1476153593, 0, '', '', '', '', '', '', 'CCH THC T HNG BN CNG TY SC HOA', '', 2, 'Cch thc t hng bn cng ty sc hoa', 'Cch thc t hng bn cng ty sc hoa', 'Cch thc t hng bn cng ty sc hoa', 'he-thong', 1);
INSERT INTO `table_about` (`id`, `title_vi`, `title_en`, `keywords_vi`, `keywords_en`, `description_vi`, `description_en`, `ten_jp`, `tenkhongdau`, `mota_vi`, `noidung_vi`, `noidung_en`, `photo`, `thumb`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `title_jp`, `description_jp`, `mota_en`, `mota_jp`, `noidung_jp`, `keywords_jp`, `ten_vi`, `ten_en`, `luotxem`, `h1`, `h2`, `h3`, `type`, `noibat`) VALUES
(78, '', '', '', '', '', '', '', '10-ngoi-sao-xuat-chung-nhung-huong-muc-luong-khong-tuong-xung-voi-tai-nang', '10 cu th sau y l nhng ngi cc k ti nng v chim vai tr v cng quan trng trong mu o cu lc b cng nh tuyn quc gia, tuy nhin h hin nhn c mc lng kh thp so vi cc siu sao khc  cng v tr. ng ch  hn khi danh sch ny c s xut hin ca nhng Antoine Griezmann, Thomas Muller hay Marcelo.', '<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 0px 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">1. Keylor Navas  55 nghn bng/tun</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="FBL-EUR-C1-REALMADRID-ATLETICO" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b04f44e866f03452000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="PIERRE-PHILIPPE MARCOU/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Th thnh s mt ca Real Madrid k t sau khi Iker Casillas ra i. Lun thi u v cng xut sc v em n s an tm ln trong khung g.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Thit lp&nbsp;k lc gi sch li  Champions League ma trc, gp phn a Kn kn tin n danh hiu La Decima.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Hin Navas ch hng mc lng vn vn&nbsp;55 nghn bng/tun, v vy ban lnh o Real  tnh n chuyn gia hn v tng lng  tng thng cho ngi gc n Costa Rica.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">2. Marcelo  80 nghn bng/tun</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="FBL-EUR-C1-REALMADRID-ATLETICO-CELEBRATION" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b04f76b834bc1c13000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="JAVIER SORIANO/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Ngi hng ng ngha ca Real Madrid, lun thi u xut sc trn sn, c xem l hu v tri s mt th gii nhng cha bao gi i hi chuyn lng bng.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Tuy vy sau mt thp k cng hin trong mu o trng vi hn 350 ln ra sn, Marcelo xng ng c hng mc lng thuc top "cng thn", thay v ch ngang bng "ngi tha" Fabio&nbsp;Coentrao nh hin nay,&nbsp;80 nghn bng/tun.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">3. Michael Carrick  100 nghn bng/tun</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Manchester United v Crystal Palace - The Emirates FA Cup Final" class="post-cover__media post-cover__media--image" src="http://images0.minutemediacdn.com/production/912x516/57b0735eb834bc3f3d000023.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Paul Gilham/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">10 nm cng hin cho Manchester United, lun nm trong top cc tin v trung tm xut chng nht nc Anh, gip Qu  em v v s danh hiu cao qu, th nhng phi n h ny ban lnh o Manchester United mi quyt nh tng lng cho Michael Carrick t 80 nghn bng/tun ln 100 nghn bng/tun. Trc , cng thn ca United ch hng mc i ng ngang nga "ca n" Marouane Fellaini.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">4. Claudio Bravo  33.5 nghn bng/tun</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="International Champions Cup: Liverpool v Barcelona" class="post-cover__media post-cover__media--image" src="http://images0.minutemediacdn.com/production/912x516/57b074d42613945f7d000002.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Mike Hewitt/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">t ai bit, th thnh s mt ca Barcelona  La Liga ma va qua&nbsp;Claudio Bravo hng mc lng v cng bo bt. i ng ca anh thm ch cn km hn mt s cu th tr.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Nu bn bit ngi gc n d b ca Arsenal David Ospina cn hng lng n 40 nghn bng/tun, hay "ngi tha" Vermaelen nhn n 55.5 nghn bng/tun, th chuyn&nbsp;Claudio Bravo&nbsp;ng gp rt nhiu nhng hng lng t hn ng l v l.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">iu ny c l xut pht t vic phn chia qu lng bt hp l ca Barcelona. V vy ng ngc nhin nu&nbsp;Claudio Bravo sp ti ri Nou Camp  gia nhp Manchester City. i bng ca Pep Guardiola ang cho ko Bravo vi sut bt chnh cng&nbsp;mc lng hp dn.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">5. Kurt Zouma  40 nghn bng/tun</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="FBL-ENG-PR-ARSENAL-CHELSEA" class="post-cover__media post-cover__media--image" src="http://images0.minutemediacdn.com/production/912x516/57b2ccf091a77874f5000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="BEN STANSALL/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Tng lai ca Chelsea v c i tuyn Php, l mt trong nhng trung v tr xut sc nht th gii thi im hin ti, nhng tht kh tin khi Kurt Zouma ch hng mc lng thuc top di  Stamford Bridge.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Ngay c chuyn gia d b nh Loic Remy cn s hu i ng ln ti 85 nghn bng/tun. V vy, c th trong thi gian sp ti Chelsea s xem xt gia hn tng lng nhm tng thng cho ti nng ca&nbsp;Kurt Zouma.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">6. Laurent Koscielny  60 nghn bng/tun</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Arsenal v Newcastle United - Premier League" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b2cf6b261394efea000005.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Shaun Botterill/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Arsenal c th dnh cho Theo Walcott - mt siu d b vi bn hp ng c mc lng ln ti 110 nghn bng/tun (ch km Mesut Ozil, Alexis Sanchez), th nhng&nbsp;vi trung v s mt Laurent Koscielny ca h, cu th ny ch nhn c mc i ng khim tn 60 nghn bng tun.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Thm ch cn thp hn c nhm cu th&nbsp;Olivier Giroud, Jack Wilshere, Mathieu Debuchy, Per Mertesacker,... Hp ng ca Koscielny vi Arsenal cng s mn hn vo ma h 2017 ti, v vy ban lnh o Pho th cn sm ngh n chuyn tng lng  gi chn tr ct ca mnh.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">7. Coutinho  70 nghn bng/tun</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Arsenal v Liverpool - Premier League" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b2d23ee866f0dbb4000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Mike Hewitt/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">C th ni sau nhng nim hy vng s mt mang tn Luis Suarez v Raheem Sterling, Philippe Coutinho lc ny chnh l linh hn ca Liverpool di triu i Jurgen Klopp.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Tuy vy, sau khi t bt k&nbsp;cam kt tng lai vi L on  n tn 2020 vo u nm ngoi, Coutinho ch c tng lng "nh git" ln 70 nghn bng/tun.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Kh bt cng vi tin v ngi Brazil nu bn bit, ngay c Christian Benteke cn t ti 140 nghn bng/tun.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">8. Leonardo Bonucci  62.5 nghn bng/tun</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="AC Milan v Juventus FC - TIM Cup Final" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b2d79ae866f00f0c00000d.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Giuseppe Bellini/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Mt trong nhng trung v xut sc nht th gii nhng ch hng mc lng thp so vi mt bng chung  cc gii u hng u chu u.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Leonardo Bonucci c c Chelsea ln Manchester City cho ko, h sn sng tr mc lng&nbsp;140 nghn bng/tun cho Bonucci. Chnh iu ny  khin ban lnh o Juventus lo st v, d anh mi gia hn n nm 2020 vo nm ngoi.&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;"> trnh mt tr ct vo tay cc i gia khc, Lo b  ln k hoch gi chn Bonucci vi mc lng&nbsp;100 nghn bng/tun. Vn thp hn  ngh ca&nbsp;Chelsea v Manchester City nhng  thuc hng top  Juve.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">9. Thomas Muller  125 nghn bng/tun</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Borussia Dortmund v FC Bayern Muenchen - DFL Supercup 2016" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b2d912b834bc9c15000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Sascha Steinbach/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Ch tch Bayern Munich, ng Karl-Heinz Rummenigge tng pht biu hi u thng 8 v k hoch gia hn hp ng vi Robert Lewandowski rng: "Cu lc b s khng bao gi tr mc lng in r cho cc cu th".&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;"> cng c th l mt phn l gii v sao mt siu sao nh Thomas Muller ch hng lng 125 nghn bng mi tun  Bundesliga. Thm ch cn km hn mt s ngi sao d b  Premier League.</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Nhng may mn thay cho Hm xm, h ang s hu mt&nbsp;Thomas Muller nht mc trung thnh.  k chuyn nhng thng Ging u nm, tin o ny va t chi  ngh vi mc lng 300 nghn bng/tun ca Manchester United.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">10. Antoine Griezmann  112 nghn bng/tun</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="FBL-EUR-C1-REALMADRID-ATLETICO" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b2dd4d261394b66f000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="FILIPPO MONTEFORTE/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Vi ti nng ca mnh,&nbsp;Antoine Griezmann xng ng hng mc lng thuc hng top chu u d cn kh tr. Tin chc, nu cu th tng&nbsp;gip Atletico Madrid gp mt  trn chung kt Champions League v tuyn Php  trn chung kt EURO 2016 gia nhp cc i gia khc, anh&nbsp;c th t ti khong i ng ln ti hng 2.</p>\r\n</div>\r\n', '', '60250067.png', '', 1, 1, 1471358563, 0, '', '', '', '', '', '', '10 ngi sao xut chng nhng hng mc lng khng tng xng vi ti nng', '', 0, '', '', '', 'tin-tuc', 1),
(79, '', '', '', '', '', '', '', 'liverpool-tu-choi-de-nghi-mua-benteke-cua-crystal-palace', 'Liverpool va mi chnh thc t chi li  ngh chiu m tin o Christian Benteke t Crystal Palace, ban lnh o ca Liverpool khng chp nhn mc gi m pha Crystal Palace a ra dnh cho chn st ny.', '<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; color: rgb(67, 67, 67); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: justify; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">Liverpool va mi chnh thc t chi li  ngh chiu m tin o&nbsp;<span style="outline: none; box-sizing: inherit; font-size: 1em; background-color: initial;">Christian Benteke t Crystal Palace, ban lnh o ca Liverpool khng chp nhn mc gi m pha Crystal Palace a ra dnh cho chn st ny.</span></p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; color: rgb(67, 67, 67); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; color: rgb(67, 67, 67); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: justify; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="outline: none; box-sizing: inherit; font-size: 1em; background-color: initial;">C th, Crystal Palace chnh thc gi ti Liverpool li  ngh tr gi 30 triu bng dnh cho&nbsp;</span><span style="outline: none; box-sizing: inherit; font-size: 1em; background-color: initial;">Christian Benteke. Li  ngh 30 triu bng ny bao gm 23 triu bng tr ngay, cng thm 7 triu bng ty thnh tch, ng gp ca Benteke cho Crystal Palace. Liverpool cho rng con s  khng hp l v h  t chi.</span></p>\r\n\r\n<div class="image-container image-container imageEmbedded" data-afp_image="false" data-credit="PAUL ELLIS/GettyImages" data-crop="{&quot;x&quot;:0,&quot;y&quot;:0,&quot;w&quot;:0.9382716049382716,&quot;h&quot;:1}" data-date="2016-05-11" data-description="Liverpool''s Christian Benteke celebrates after scoring his team''s first goal during the English Premier League football match between Liverpool and Chelsea at Anfield in Liverpool, north west England on May 11, 2016. / AFP / PAUL ELLIS / RESTRICTED TO EDITORIAL USE. No use with unauthorized audio, video, data, fixture lists, club/league logos or ''live'' services. Online in-match use limited to 75 images, no video emulation. No use in betting, games or single club/league/player publications.  /         (Photo credit should read PAUL ELLIS/AFP/Getty Images)" data-getty_image="true" data-is-animated="false" data-large_url="http://cache4.asset-cache.net/gc/530774676-liverpools-christian-benteke-celebrates-gettyimages.jpg?v=1&amp;c=IWSAsset&amp;k=2&amp;d=X7WJLa88Cweo9HktRLaNXpr62gJuQD%2fBOOpWiPQ%2bv5eHRecwDk834uyVxewkmu4Y&amp;b=NTM=" data-ratio="4/3" data-title="FBL-ENG-PR-LIVERPOOL-CHELSEA" data-url="http://90min-images-original.s3.amazonaws.com/production/57b2e7cd2613940e3a000001.jpg" style="outline: none; box-sizing: inherit; clear: both; min-width: 260px; margin: 22px 0px;"><i class="wrapper" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; background-image: initia