ns'', sans-serif, nm-icons; line-height: 24px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; color: rgb(67, 67, 67); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: justify; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;"><span style="outline: none; box-sizing: inherit; font-size: 1em; background-color: initial;">Bn thn tin o ngi B cng  thc c vic anh khng cn tng lai  sn Anfield, cu th ny tng cng khai tha nhn mnh sau lm khi chuyn ti Liverpool v ang cng ngi i din cn nhc kh nng chia tay i bng vng Merseyside.&nbsp;</span></p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; color: rgb(67, 67, 67); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">&nbsp;</p>\r\n\r\n<p data-label="Th ti y " style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; color: rgb(67, 67, 67); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: justify; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">u thng by va qua, Liverpool nhn c li  ngh u tin t&nbsp;<span 