(80, '', '', '', '', '', '', '', 'di-tim-nguoi-hung-cua-vong-dau-dau-tien', 'Vng u u tin ca gii Ngoi hng Anh ma gii 2016-2017  din ra ht sc hp dn, v di y l 5 ci tn xng ng c vinh danh ngi hng ca vng u ny.', '<div class="introduction" style="outline: none; box-sizing: inherit; margin-bottom: 2em; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); background: transparent;">Vng u u tin ca gii Ngoi hng Anh ma gii 2016-2017  din ra ht sc hp dn, v di y l 5 ci tn xng ng c vinh danh ngi hng ca vng u ny.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 0px 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">5. Ibrahimovic</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="AFC Bournemouth v Manchester United - Premier League" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b2c61baada7f3ef1000006.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Stu Forster/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); background: transparent;">Ibra i n u, ngi ta phi ni v anh  . Ibra i n u, anh ghi bn cho i bng  trong ngy khai mc. Ibra ghi bn mang v chc v ch Community Shield cho Man United, ri li tip tc st tung li Bournemouth gip i qun ca Mourinho ginh 3 im thuyt phc. Vi siu sao ngi Thy in, dng nh i ch sn Old Trafford  tm c mnh ghp cn thiu by lu nay, mt st th vi thi quen ginh chc v ch.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">4. Diego Costa</h2>\r\n\r\n<div class="video-container" itemprop="video" itemscope="" itemtype="http://schema.org/VideoObject" style="outline: none; box-sizing: inherit; position: relative; max-width: none; width: 683.984px; margin: 0px auto 36px; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--video" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; display: block; max-width: inherit; background-color: transparent;"><iframe allowfullscreen="allowfullscreen" class="embeded-video-player post-cover__media post-cover__media--video Youtube" frameborder="0" name="Video_Youtube" scrolling="no" src="http://www.youtube.com/embed/IdAEBsdaKRc" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border-width: 0px; border-style: initial; vertical-align: baseline; position: absolute; height: 384.734px; top: 0px; left: 0px; width: 683.984px; max-width: none; background: transparent;" type="text/html" webkitallowfullscreen="webkitallowfullscreen"></iframe></figure>\r\n</div>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); background: transparent;">Ngi ta gi Costa l ng vua  bn hn l phi c l do ca n. Pha phm li ca anh vi th mn Adryan xng ng phi nhn t nht l mt chic th vng, nhng tht may cho anh l trng ti  b qua mt trong nhng tnh hung bo lc nht  vng u u tin. Nhng im khc bit gia Diego Costa  ma gii ny vi chnh anh  ma gii trc l bn thng. Pha khng ch v dt im cc k him hc t ngoi vng cm ca cu tin o Atletico gi nh li thi k phong  hong kim ca anh vi nm trc, v cng ng thi mang v 3 im cc k quan trng trong ngy ra mt ca Antonio Conte.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">3. Philippe Coutinho</h2>\r\n\r\n<div class="video-container" itemprop="video" itemscope="" itemtype="http://schema.org/VideoObject" style="outline: none; box-sizing: inherit; position: relative; max-width: none; width: 683.984px; margin: 0px auto 36px; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--video" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; display: block; max-width: inherit; background-color: transparent;"><iframe allowfullscreen="allowfullscreen" class="embeded-video-player post-cover__media post-cover__media--video Youtube" frameborder="0" name="Video_Youtube" scrolling="no" src="http://www.youtube.com/embed/zOxodG8qLtU" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border-width: 0px; border-style: initial; vertical-align: baseline; position: absolute; height: 384.734px; top: 0px; left: 0px; width: 683.984px; max-width: none; background: transparent;" type="text/html" webkitallowfullscreen="webkitallowfullscreen"></iframe></figure>\r\n</div>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); background: transparent;">Ngi sao ngi Brazil chnh l cu th ng ch  nht ca vng u u tin vi 2 bn thng v 1 pha kin to, tt c u rt ng cp. Trong mt i hnh tr vi nhiu tn binh nh Liverpool, Coutinho ni bt ln vi vai tr khng ch l ngi dn dt li chi m cn trc tip ghi bn, gieo rc ni kinh hong cho hng th chp v ca Arsenal. Pha st pht cn bng t s  cui hip 1 ca anh thm ch c th lt vo danh sch nhng bn thng p nht ma gii nm nay.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">2. Robert Snodgrass</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="FBL-ENG-PR-HULL-LEICESTER" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b2c578e866f05008000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="LINDSEY PARNABY/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); background: transparent;">Nhn vt chnh trong trn m u ma gii Ngoi hng Anh khng n t nh ng kim v ch Leicester City, m li l mt ci tn t ngi ng n, Robert Snodgrass ca Hull City. Cu th chy cnh ngi Scotland thc hin qu pht gc chun mc to c hi cho Abel Hernandez volley tuyt p m t s, v sang hip 2 n nh chin thng cho Nhng ch h vi c dt im gn gng h gc Kasper Schmeichel. Ln u tin k t nm 1990 nh v ch Ngoi hng Anh mi tht bi  trn m mn, v thnh tch y mang du n ln ca Snodgrass.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">1. Eric Bailly</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="AFC Bournemouth v Manchester United - Premier League" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b2c54faada7fd86e000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Michael Steele/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); background: transparent;">Zlatan Ibrahimovic ghi bn, Rooney ghi bn, Mourinho ra mt n tng, nhng khng th khng nhc n Eric Bailly. Trung v ngi B Bin Ng chnh l tn binh thi u n nh nht ca Man United tnh n thi im ny, vi kh nng tranh chp vt tri v li chi bnh tnh, chc chn. T Telegraph cn nhn xt Bailly l trung v hay nht ca Qu  thnh Manchester k t sau thi k ca Nemanja Vidic. Trong trn u vi Bournemouth hm th By va ri, Bailly  c 7 pha ph bng, 3 c tc v t t l chuyn chnh xc ln ti 95.1%, nhng con s ht sc n tng.</p>\r\n</div>\r\n', '', '89059998.png', '', 1, 1, 1471358676, 0, '', '', '', '', '', '', 'i tm ngi hng ca vng u u tin', '', 0, '', '', '', 'tin-tuc', 1),
(81, '', '', '', '', '', '', '', 'arsenal-leicester-thong-tri-doi-hinh-te-nhat-vong-1-premier-league', 'Arsenal v Leicester City chnh l hai i bng gy tht vng trong ngy khai mn Premier League. Arsenal d c thi u trn sn nh tuy nhin khng th ginh c chin thng trc Liverpool trong khi nh ng kim v ch Leicester City  thua trc i bng va mi ln hng Hull City.', '<div class="introduction" style="outline: none; box-sizing: inherit; margin-bottom: 2em; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Arsenal v Leicester City chnh l hai i bng gy tht vng trong ngy khai mn Premier League. Arsenal d c thi u trn sn nh tuy nhin khng th ginh c chin thng trc Liverpool trong khi nh ng kim v ch Leicester City  thua trc i bng va mi ln hng Hull City.</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Nhng mn trnh din t ca hai i bng trn khin cho h p o trong i hnh t nht vng 1 Premier League.</p>\r\n\r\n<hr style="outline: none; box-sizing: inherit; border-top-width: 0px; height: 3px; width: 547.188px; margin: 36px auto; background: rgba(0, 0, 0, 0.0980392);" /></div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 0px 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-o