ckground-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">3. Trung v: Paddy McNair (Sunderland)</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Manchester City v Sunderland - Premier League" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b296bae866f0a4bb000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Michael Steele/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Vo sn t bng gh d b v  phn li nh ngay trong trn u ra qun dn n tht bi ca Sunderland trc Manchester City.</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">&nbsp;</p>\r\n\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Mt trn u ng qun cho sao mai tng khoc o Manchester United.</p>\r\n</div>\r\n\r\n<h