ng vi t s 4-3.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">5. Hu v tri: Alberto Moreno (Liverpool)</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Huddersfield Town v Liverpool - Pre-Season Friendly" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b29841261394cabc000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Nigel Roddis/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Alberto Moreno thi u t trong trn u vi Arsenal, cu th ngi Ty Ban Nha khin i nh phi chu mt qu penalty cng vi  l li b v tr khin cho&nbsp;Theo Walcott tha mi ghi bn.&nbsp;Moreno cn phi ci thin kh nng phng ng nu nh mun c tng lai ti sn Anfield.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">6. Tin v trung tm: Mohamed Elneny (Arsenal)</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Arsenal v Manchester City: Pre-Season Friendly" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b298dfe861a13d8c00001d.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Nils Petter Nilsson/Ombrello/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Mohamed Elneny hon ton mt ht trong h thng tin v ca Arsenal, cu th ny khng th gip cho Pho th ly li tuyn gia khi m cc tin v bn pha Liverpool chi hay, sung sc.  cng l mt phn nguyn nhn khin Arsenal nh mt th trn v  thua trc Liverpool.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">7. Tin v trung tm: Andy King (Leicester City)</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Hull City v Leicester City - Premier League" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b299aae866f08b82000014.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Michael Regan/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Andy King chnh l ngi c tin dng cho v tr m&nbsp;N''Golo Kant  li tuy nhin nhng g m cu th ny lm c li hon ton m nht, King khng th gip cho Leicester City c c khu vc trung tuyn, h  thua bc nhc 1-2 trc Hull City.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">8. Tin v phi: Andros Townsend (Crystal Palace)</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Crystal Palace v West Bromwich Albion - Premier League" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b29a4f91a778ad23000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Alex Broadway/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Andros Townsend l n tht vng v cng ln ca Crystal Palace ni hnh lang phi, cu th ny khng c ti mt pha i bng thnh cng, th lc ca&nbsp;Andros Townsend cng l iu cn phi ni ti khi m tc  ca anh thc s qu t  trn u ny. Palace thua West Brom 0-1.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">9. Tin v tri: Demarai Gray (Leicester City)</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Oxford United v Leicester City - Pre-Season Friendly" class="post-cover__media post-cover__media--image" src="http://images0.minutemediacdn.com/production/912x516/57b29b33701fb61fea000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Steve Bardens/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Demarai Gray l cu th c tim nng rt ln, tuy nhin cu th ny c v nh ang i vo vt xe  ca hng lot cc "thn ng cht yu" trc y ca bng  Anh.&nbsp;Demarai Gray c bo ch tung h qu nhiu trong khi mn trnh din trn sn li hon ton m nht.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">10. Tin o: Connor Wickham (Crystal Palace)</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Crystal Palace v Valencia: Pre-Season Friendly" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b29c05aada7f66f2000006.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Christopher Lee/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Connor Wickham l l do v sao m Crystal Palace ro rit sn lng tin o, cu th ny khng th p ng c lng bn thng m Palace cn, anh c kh nng chy ch tuy nhin nhng c dt im ca&nbsp;Connor Wickham thng thiu chnh xc.</p>\r\n</div>\r\n\r\n<h2 style="outline: 0px; box-sizing: inherit; font-size: 1.5rem; margin: 3rem 0px 0.5em; padding: 0px; border: 0px; vertical-align: baseline; font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-weight: 700; clear: both; line-height: 2rem; color: rgb(0, 0, 0); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;">11. Tin o: Jamie Vardy (Leicester City)</h2>\r\n\r\n<figure class="post-cover__media-wrap post-cover__media-wrap--image" itemprop="associatedMedia image" itemscope="" itemtype="http://schema.org/ImageObject" style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; font-size: 16px; vertical-align: baseline; display: block; max-width: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; line-height: 24px; text-align: start; background-color: rgb(255, 255, 255);"><img alt="Hull City v Leicester City - Premier League" class="post-cover__media post-cover__media--image" src="http://images1.minutemediacdn.com/production/912x516/57b29bd1ab9ce69d8d000001.jpg" style="outline: 0px; box-sizing: inherit; margin: 0px 0px 1em; padding: 0px; border: 0px; vertical-align: baseline; display: block; width: 683.984px; background: transparent;" title="Alex Morton/GettyImages" /></figure>\r\n\r\n<div class="text" style="outline: none; box-sizing: inherit; color: rgb(0, 0, 0); font-family: Roboto, ''Open Sans'', sans-serif, nm-icons; font-size: 16px; line-height: 24px;">\r\n<p style="outline: 0px; box-sizing: inherit; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(67, 67, 67); text-align: justify; background: transparent;">Jamie Vardy  khng th n sung trong ngy khai mn Premier League, n khin cho Leicester City ca&nbsp;anh phi nhn tht bi trc Hull City, Vardy cn phi ly li phong  ngay nu nh khng mun ri vo cuc khng hong cng Leicester.</p>\r\n</div>\r\n', '', '86369457.png', '', 1, 1, 1471358747, 0, '', '', '', '', '', '', 'Arsenal, Leicester thng tr i hnh t nht vng 1 Premier League', '', 0, '', '', '', 'tin-tuc', 1);
