INSERT INTO `table_news` (`id`, `id_item`, `tinnoibat`, `ten_vi`, `ten_en`, `tenkhongdau`, `title_vi`, `keywords_vi`, `description_vi`, `title_en`, `keywords_en`, `description_en`, `mota_vi`, `mota_en`, `noidung_vi`, `noidung_en`, `loaitin`, `photo`, `thumb`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `luotxem`, `mota_jp`, `noidung_jp`, `title_jp`, `keywords_jp`, `description_jp`, `ten_jp`, `h1`, `h2`, `h3`, `type`, `gia`) VALUES
(33, 0, 1, 'Nh u t th cp lng l ri b th trng', '', 'nha-dau-tu-thu-cap-lang-le-roi-bo-thi-truong', 'Xy Dng M Ph Gia', 'co hi xay dung,noi that ,co khi nha xuong', 'co hi xay dung,noi that ,co khi nha xuong', '', '', '', 'Trong bi cnh hng lot d n c c ch u t ti khi ng v cc nh u t mi, ngi c tim lc ti chnh gia nhp th trng BS th mt xu hng kh l ang din ra,  l, cc nh u t th cp, nht l dn u t t nn, lin k quyt nh coi y l thi im nn rt lui khi th trng.', '', '<p>Trong bi cnh h&agrave;ng lot d &aacute;n c c ch u t t&aacute;i khi ng v&agrave; c&aacute;c nh&agrave; u t mi, ngi c&oacute; tim lc t&agrave;i ch&iacute;nh gia nhp th trng BS th&igrave; mt xu hng kh&aacute; l ang din ra, &oacute; l&agrave;, c&aacute;c nh&agrave; u t th cp, nht l&agrave; d&acirc;n u t t nn, lin k quyt nh coi &acirc;y l&agrave; thi im n&ecirc;n r&uacute;t lui khi th trng.</p>\r\n\r\n<p>Ph&acirc;n t&iacute;ch thc t cho thy, c&oacute; kh&aacute; nhiu nguy&ecirc;n do khin gii u t th cp kh&ocirc;ng th chi b&agrave;i &aacute;nh u theo BS.</p>\r\n\r\n<p>L&yacute; do u ti&ecirc;n v&agrave; quan trng nht &oacute; l&agrave; kh nng t&agrave;i ch&iacute;nh. C&oacute; l c&aacute;c nh&agrave; u t th cp &atilde; qu&aacute; mt mi  c&oacute; th ch n im ri th&iacute;ch hp cho vic y h&agrave;ng ra, ly tin b&ugrave; li nhng khon vay n v&agrave; nhng nhu cu t&agrave;i ch&iacute;nh kh&aacute;c. V&igrave; thc t, th trng a c tuy c&oacute; m l&ecirc;n nhng kh&ocirc;ng d&agrave;nh cho tt c c&aacute;c ph&acirc;n kh&uacute;c.</p>\r\n\r\n<p>Thng k&ecirc; t B X&acirc;y dng cho thy, th trng BS trong qu&yacute; I/2015 &atilde; c&oacute; mc tng thanh khon cao gp 3 ln so vi c&ugrave;ng k nm ngo&aacute;i. Tng t, kt qu Thng k&ecirc; t B K hoch v&agrave; u t cng cho thy, BS ng top th 2 v thu h&uacute;t ngun vn FDI vi tng vn u t ng k&yacute; cp mi v&agrave; tng th&ecirc;m l&ecirc;n ti 202,93 triu USD, tc chim khong 11% tng s vn u t trc tip nc ngo&agrave;i trong c&ugrave;ng giai on. Tuy nhi&ecirc;n, TS. L&ecirc; Xu&acirc;n Ngha - Vin trng Vin nghi&ecirc;n cu Ph&aacute;t trin kinh doanh li &aacute;nh gi&aacute;, mt s ch&iacute;nh s&aacute;ch mi &atilde; c&oacute; t&aacute;c ng rt t&iacute;ch cc, th trng BS cng thu h&uacute;t c d&ograve;ng vn t th trng t&agrave;i ch&iacute;nh, th nhng vic chm x l&yacute; n xu vn l&agrave; ri ro ln. Nu nh&igrave;n nhn s&acirc;u hn v khon n xu ng&acirc;n h&agrave;ng th&igrave; c&aacute;c khon n li&ecirc;n quan n vic th chp BS chim t l rt cao. C&oacute; l, rt him nh&agrave; u t th cp cha tng vay vn ng&acirc;n h&agrave;ng  u t. Do &oacute;, khi BS m li, c&aacute;c khon &ldquo;gii chp&rdquo; cho th trng n&agrave;y mt c&aacute;ch t nguyn s din ra ng lot.</p>\r\n\r\n<p>Tr&ecirc;n thc t, phn &ocirc;ng nh&agrave; u t th cp u s hu sn phm t lin k ti c&aacute;c d &aacute;n KT v&agrave; nh&agrave;  chung c. Anh Nguyn Thanh Phong, mt nh&agrave; u t ang s hu l&ocirc; t rng 2.000 m2  KDC Vnh Lc A, Tp.HCM cho PV bit: &ldquo;Kinh t bt u m l&ecirc;n, do c&oacute; mt s c hi u t kh&aacute;c n&ecirc;n t&ocirc;i &atilde; quyt nh b&aacute;n mnh t n&agrave;y  gii ph&oacute;ng ngun vn. Gi&aacute; c b&acirc;y gi kh&ocirc;ng c&ograve;n l&agrave; vn  qu&aacute; quan trng, ch yu l&agrave; b&aacute;n c h&agrave;ng &atilde;&rdquo;.</p>\r\n\r\n<p>Kh&ocirc;ng ch c&oacute; anh Phong, nhiu kh&aacute;ch h&agrave;ng hin ang &ldquo;&ocirc;m&rdquo; t lin k ti c&aacute;c khu vc nh Nha Trang, H&agrave; Ni, Tp.HCM hay TP. Vinh u t r&otilde; mong mun b&aacute;n c h&agrave;ng v&agrave;o thi im n&agrave;y. n c, anh Trn Vit Tun hin ang s hu l&ocirc; t din t&iacute;ch 425 m2 ti d &aacute;n H&ograve;n Du Resort ( Sn) cho bit, anh ang t&igrave;m kh&aacute;ch y h&agrave;ng v&igrave; &ldquo;kh&ocirc;ng mun  vn nm qu&aacute; l&acirc;u&rdquo;. Theo nh&agrave; u t th cp n&agrave;y, anh mua mnh t tr&ecirc;n t nm 2005 vi gi&aacute; ch 7 triu ng/m2 nhng nay vn chp nhn b&aacute;n vi gi&aacute; 6 triu ng/m2. t ti c&aacute;c khu resort kh&ocirc;ng h d b&aacute;n v&igrave; kh&ocirc;ng phi l&agrave; t , nu mun b&aacute;n c phi i gp nhng &ldquo;ngi gi&agrave;u t&iacute;nh chuyn n chi&rdquo;. Do &oacute;, nu c&oacute; c duy&ecirc;n gp kh&aacute;ch th&igrave; c&oacute; l anh cng phi b&aacute;n.</p>\r\n\r\n<p>Mt trng hp kh&aacute;c l&agrave; ch Minh Ch&acirc;u- ngi ang s hu cn h din t&iacute;ch 107 m2 ti chung c TECCO (Th c - Tp.HCM) h hi cho bit: &ldquo;Ch m&atilde;i cng n l&uacute;c ng v&agrave;nh ai T&acirc;n Sn Nht - B&igrave;nh Li th&ocirc;ng tuyn chy thng qua ca chung c, khi lao xao c&oacute; tin n thi gi&aacute; chung c n&agrave;y s tng, th l&agrave; c&oacute; kh&aacute;ch hi m&igrave;nh sn s&agrave;ng gim gi&aacute;  c&oacute; th b&aacute;n nhanh. Ly ngay 1,7 t ng gi ng&acirc;n h&agrave;ng cho chc, c&ograve;n hn i ch th&ecirc;m. Nu kh&ocirc;ng b&aacute;n trong ln n&agrave;y,  li cho thu&ecirc; cng ch c khong 6 triu ng/th&aacute;ng.&rdquo;</p>\r\n\r\n<p>C&ograve;n ch Hng hin ang &ldquo;&ocirc;m&rdquo; 3 l&ocirc; t ti KCN Nhn Trch 1 cho bit: &ldquo;Ch i c nm thy gi&aacute; c chng thay i, so vi l&uacute;c mua cng &atilde; l c trm triu ng, th nhng &agrave;nh tc li b&aacute;n v&igrave; cng kh&ocirc;ng kinh doanh c g&igrave;. Li th&ecirc;m sp ti s c&oacute; d &aacute;n &ocirc; th mi ri nh&agrave;  cho c&ocirc;ng nh&acirc;n,  n l&uacute;c &oacute; th&igrave; t m&igrave;nh c&agrave;ng kh&oacute; b&aacute;n&rdquo;.</p>\r\n\r\n<p>Anh Ho&agrave;ng th&igrave; va b&aacute;n xong 2 cn h chung c thuc loi trung v&agrave; cao cp ti Tp.HCM. Anh n&agrave;y cho bit, l&yacute; do khin anh buc phi &ldquo;y h&agrave;ng&rdquo; l&uacute;c n&agrave;y v&igrave; cha bit mc ph&iacute; c th  chung c. Trng hp mc ph&iacute; thu cao th&igrave; c hi y h&agrave;ng tn l&uacute;c &oacute; s rt kh&oacute;. Ph&iacute; v&agrave; dch v ch&iacute;nh l&agrave; hai yu t m&agrave; ngi mua nh&agrave; quan t&acirc;m nhiu sau nhng &ldquo;l&ugrave;m x&ugrave;m&rdquo; v vn  qun l&yacute; chung c, thu ph&iacute; tng xy ra trc &acirc;y. C&oacute; ln phi chng kin cnh bo v mt chung c chy l&ecirc;n mng ch nh&agrave; t&eacute; t&aacute;t cng ch v&igrave; &ldquo;kh&aacute;ch nh&agrave; b&agrave;&rdquo; c phi &ocirc; t&ocirc; vun v&uacute;t i m&agrave; kh&ocirc;ng tr v&eacute;, tr tin gi. Anh Ho&agrave;ng k v&agrave; ngao ng&aacute;n: &ldquo;Gp phi chung c kiu n&agrave;y th&igrave; ch c&oacute; nc cho thu&ecirc;&rdquo;.</p>\r\n\r\n<p>&Ocirc;ng L&ecirc; Ho&agrave;ng Ch&acirc;u, Ch tch Hip hi BS Tp.HCM &aacute;nh gi&aacute;: &ldquo;Th trng a c hin gi vn ch yu d&agrave;nh cho nhng ngi mua c&oacute; nhu cu thc hn l&agrave; d&acirc;n u c. Chuyn th trng tng gi&aacute; ng lot kh&oacute; c&oacute; th xy ra trong thi gian ti, do &oacute; thi im hin nay rt th&iacute;ch hp  c&aacute;c nh&agrave; u t th cp b&aacute;n bt h&agrave;ng tn m&agrave; h &atilde; b &quot;ng&acirc;m&quot; qu&aacute; l&acirc;u trc &oacute;&quot;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&Ocirc;ng Ch&acirc;u cng cho bit th&ecirc;m, xu hng tr&ecirc;n cng l&agrave; din bin hp l&yacute; trong bi cnh hin nay v&agrave; n&oacute; c&ograve;n gi&uacute;p th trng ph&aacute;t trin l&agrave;nh mnh hn. Kinh nghim thc t cho thy, hu ht nhng cn st BS tng xy ra u xut ph&aacute;t t t nn v&agrave; thi im hin nay, ph&acirc;n kh&uacute;c n&agrave;y vn cha thy c&oacute; ng lc n&oacute;ng tr li.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '17936916.png', '17936916_120x80.png', 1, 1, 1432220817, 1444184990, 6, '', '', '', '', '', '', '', '', '', 'tin-tuc', 0),
(35, 0, 1, 'T vn chn vt liu tng cng trong xy dng', '', 'tu-van-chon-vat-lieu-tang-cung-trong-xay-dung', 'Xy Dng M Ph Gia', 'xay dung nha cac li,noi that,co kh xay dung', 'xay dung nha cac li,noi that,co kh xay dung', '', '', '', 'Trong th trng vt liu xy dng, sn phm tng cng (hay cn gi l hardener) kh ph bin, v c rt nhiu n v - t ch u t n tng thu xy dng - bit n.', '', '<p><strong>Trong th trng vt liu x&acirc;y dng, sn phm tng cng (hay c&ograve;n gi l&agrave; hardener) kh&aacute; ph bin, v&agrave; c rt nhiu n v - t ch u t n tng thu x&acirc;y dng - bit n.</strong></p>\r\n\r\n<p>Vt liu n&agrave;y c&oacute; hai loi l&agrave; dng lng v&agrave; dng bt. C&aacute;c vt liu c cung ng tr&ecirc;n th trng Vit Nam hin nay ch yu l&agrave; dng bt. Tuy nhi&ecirc;n, loi vt liu n&agrave;y trong qu&aacute; tr&igrave;nh s dng &atilde; bc l mt s hn ch nh ch c&oacute; th thi c&ocirc;ng c tr&ecirc;n nn b&ecirc; t&ocirc;ng mi  (b&ecirc; t&ocirc;ng ti), kh&ocirc;ng th thi c&ocirc;ng tr&ecirc;n nn b&ecirc; t&ocirc;ng &atilde; v&agrave; ang s dng&hellip;v&igrave; vy phm vi ng dng b thu hp.</p>\r\n\r\n<p>Mt hai nm tr li &acirc;y, vt liu tng cng dng lng (liquid hardener), vi nhng u th c bit, &atilde; c&oacute; mt ti th trng Vit Nam  dn dn thay th cho vt liu tng cng dng bt.</p>\r\n\r\n<p>Bng ch&iacute;nh nhng u th m&agrave; sn phm dng bt kh&ocirc;ng c&oacute; c, vt liu tng cng dng lng &atilde; to ra s kh&aacute;c bit v&ocirc; c&ugrave;ng ln trong kh nng, phm vi ng dng v&agrave;o c&aacute;c c&ocirc;ng tr&igrave;nh x&acirc;y dng, cng nh mang n cho ngi s dng mt la chn mi ti u hn.</p>\r\n\r\n<p>Hin ti tr&ecirc;n th trng Vit Nam c&oacute; mt v&agrave;i n v c&oacute; kh nng cung ng vt liu tng cng dng lng, trong &oacute; phi k n KRETOP International. &acirc;y l&agrave; c&ocirc;ng ty a quc gia c&oacute; tr s ti Kuala Lumpur &ndash; Malaysia, chuy&ecirc;n cung cp c&aacute;c vt liu c chng bo v s&agrave;n b&ecirc; t&ocirc;ng v&agrave; vt liu chng n m&ograve;n ti c&aacute;c nc ch&acirc;u &Aacute; nh Singapore, Indonesia, Vit Nam...</p>\r\n\r\n<p>C&oacute; mt ti th trng Vit Nam gn 10 nm v&agrave; hin l&agrave; mt n v c&oacute; th mnh v nghi&ecirc;n cu ph&aacute;t trin, sau th&agrave;nh c&ocirc;ng ca c&aacute;c sn phm c kh&aacute;ch h&agrave;ng &aacute;nh gi&aacute; rt cao nh sn epoxy a nng EPOKRETE, sn du c&ocirc;ng nghip d&ugrave;ng cho st th&eacute;p BC Gard, &hellip; KRETOP tip tc gii thiu sn phm tng cng, to m&agrave;u v&agrave; &aacute;nh b&oacute;ng s&agrave;n b&ecirc; t&ocirc;ng KRETOP LH 300 vi c&ocirc;ng ngh nano lithium u vit bc nht hin nay.</p>\r\n\r\n<p>KRETOP LH 300 l&agrave; vt liu tng cng dng lng, to m&agrave;u v&agrave; &aacute;nh b&oacute;ng s&agrave;n b&ecirc; t&ocirc;ng c&oacute; u th vt tri so vi vt liu dng bt nh: C&oacute; th thi c&ocirc;ng trc tip tr&ecirc;n nn b&ecirc; t&ocirc;ng c v&agrave; mi; Kh&ocirc;ng cha VOC v&agrave; th&acirc;n thin vi m&ocirc;i trng; C&oacute; th to m&agrave;u cho b&ecirc; t&ocirc;ng; Kh&ocirc;ng b h&oacute;a v&agrave;ng, phai m&agrave;u hay mt m&agrave;u theo thi gian; B mt ho&agrave;n thin cng v&agrave; chng b&aacute;m bi; Chng b&aacute;m vt b&aacute;nh xe cao su; S dng c&agrave;ng l&acirc;u c&agrave;ng b&oacute;ng, c&agrave;ng p;  bn vnh vin do LH 300 thm thu v&agrave;o trong b&ecirc; t&ocirc;ng v&agrave; gi&uacute;p tit kim chi ph&iacute; bo tr&igrave;, bo dng v&agrave; Vnh vin kh&ocirc;ng bong tr&oacute;c.</p>\r\n\r\n<p>Sn phm c&oacute; th c ng dng rng r&atilde;i cho c&aacute;c khu vc nh tng hm, b&atilde;i u xe, nh&agrave; xng, s&agrave;n nh&agrave; kho, trung t&acirc;m thng mi, nh&agrave; m&aacute;y cao su, si&ecirc;u th, nh&agrave; m&aacute;y sn xut c kh&iacute;, dt may, da giy ...</p>\r\n\r\n<p>c bit, vi nhng u th nht nh so vi vt liu dng bt n&ecirc;n KRETOP LH 300 &atilde; c rt nhiu n v s dng, c&oacute; th k n nh ti Nh&agrave; m&aacute;y Sumiden Vit Nam, Nh&agrave; m&aacute;y Suntory PepsiCo, Nh&agrave; m&aacute;y Tun Bng&hellip;</p>\r\n\r\n<p><strong>Theo Baodautu.vn</strong></p>\r\n', '', '', '57041785.png', '57041785_120x80.png', 1, 1, 1432377574, 1444184959, 6, '', '', '', '', '', '', '', '', '', 'tin-tuc', 0),
(34, 0, 1, 'B trng Trnh nh Dng lm vic ti TP Cn Th', '', 'bo-truong-trinh-dinh-dung-lam-viec-tai-tp-can-tho', 'Xy Dng M Ph Gia', 'Cng ty xay dng m ph gia,chuyen xay dung con g trinh,noi that', 'Cng ty xay dng m ph gia,chuyen xay dung con g trinh,noi that', '', '', '', 'T l  th ha t 65%\r\n\r\nTi bui lm vic, B trng Trnh nh Dng nh gi cao vai tr ca TP Cn Th vi t cch l mt a bn trng im kinh t ca vng ng bng sng Cu Long, to ra i trng pht trin  gp phn pht trin hi ha khu vc pha Nam gia ng Nam b v Ty Nam b. Vi li th ny', '', '<p>&nbsp;</p>\r\n\r\n<p><strong>T l &ocirc; th h&oacute;a t 65%</strong></p>\r\n\r\n<p>Ti bui l&agrave;m vic, B trng Trnh &igrave;nh Dng &aacute;nh gi&aacute; cao vai tr&ograve; ca TP Cn Th vi t c&aacute;ch l&agrave; mt a b&agrave;n trng im kinh t ca v&ugrave;ng ng bng s&ocirc;ng Cu Long, to ra i trng ph&aacute;t trin  g&oacute;p phn ph&aacute;t trin h&agrave;i h&ograve;a khu vc ph&iacute;a Nam gia &ocirc;ng Nam b v&agrave; T&acirc;y Nam b. Vi li th n&agrave;y, TP Cn Th &atilde; t c tc  tng trng cao, xp x 13-14%. C cu kinh t chuyn dch mnh theo hng tng t trng dch v v&agrave; c&ocirc;ng nghip. Cn Th &atilde; khng nh l&agrave; mt &ocirc; th dch v hp dn, c&oacute; hng i vng, to ra ng lc ph&aacute;t trin cho to&agrave;n v&ugrave;ng v&agrave; khu vc l&acirc;n cn, l&agrave; ni ti&ecirc;u d&ugrave;ng, cung cp sn phm ca khu vc v&agrave; v&ugrave;ng l&acirc;n cn.</p>\r\n\r\n<p>Theo B trng Trnh &igrave;nh Dng, lnh vc qun l&yacute; u t x&acirc;y dng v&agrave; ph&aacute;t trin &ocirc; th ca TP Cn Th t c kt qu quan trng, nh s coi trng c&ocirc;ng t&aacute;c quy hoch, c&aacute;c quy hoch chuy&ecirc;n ng&agrave;nh v&agrave; c bit l&agrave; quy hoch x&acirc;y dng.</p>\r\n\r\n<p>Vic x&aacute;c nh c nhng d &aacute;n trng im  u t, l&agrave; nh&acirc;n t quyt nh thu h&uacute;t u t cho TP. Cn Th &atilde; huy ng c nhiu ngun t&agrave;i tr cho c&aacute;c d &aacute;n nh: D &aacute;n N&acirc;ng cp &ocirc; th ng bng s&ocirc;ng Cu Long, ang &agrave;m ph&aacute;n D &aacute;n ng ph&oacute; vi bin i kh&iacute; hu, chng ngp v&agrave; nhiu d &aacute;n kh&aacute;c do doanh nghip u t. iu n&agrave;y gi&uacute;p TP to ra nhiu sn phm mi, th&uacute;c y qu&aacute; tr&igrave;nh tng trng, ph&aacute;t trin.</p>\r\n\r\n<p>B&ecirc;n cnh &oacute;, TP Cn Th cng l&agrave; mt trong nhng a phng i u trong thc hin Ngh nh 11/2013/N-CP v qun l&yacute; u t ph&aacute;t trin &ocirc; th. T l &ocirc; th h&oacute;a cao, t 65%.</p>\r\n\r\n<p>Tuy nhi&ecirc;n, theo &aacute;nh gi&aacute; ca B trng Trnh &igrave;nh Dng, TP Cn Th cng c&oacute; nhng th&aacute;ch thc kh&ocirc;ng nh khi g&aacute;nh v&aacute;c tr&aacute;ch nhim l&agrave; ng lc ca v&ugrave;ng. Sc hp dn cao &atilde; to ra tc  &ocirc; th h&oacute;a nhanh, d&acirc;n s tng nhanh, t &oacute; g&acirc;y &aacute;p lc v giao th&ocirc;ng, dch v, cp tho&aacute;t nc, v sinh m&ocirc;i trng, y t, gi&aacute;o dc v&agrave; &agrave;o to.</p>\r\n\r\n<p>Hn th, TP Cn Th cng l&agrave; mt trong nhng a phng chu nh hng nht ca bin i kh&iacute; hu, do c th&ugrave; v tr&iacute; a l&yacute;, trong khi ch&uacute;ng ta cha c&oacute; kinh nghim trin khai, s dng mi ngun lc cho bin i kh&iacute; hu mt c&aacute;ch hiu qu nht.</p>\r\n\r\n<p><strong>Tip tc y mnh qun l&yacute; u t x&acirc;y dng</strong></p>\r\n\r\n<p>Ti bui l&agrave;m vic, B trng Trnh &igrave;nh Dng cng  ngh TP Cn Th tip tc y mnh c&ocirc;ng t&aacute;c qun l&yacute; u t x&acirc;y dng. Trc ht l&agrave; c th h&oacute;a quy hoch chung sau khi &atilde; r&agrave; so&aacute;t, kp thi iu chnh cho ph&ugrave; hp vi thc tin, la chn u t h tng ph&ugrave; hp. C&ocirc;ng t&aacute;c qun l&yacute; cht lng c&ocirc;ng tr&igrave;nh x&acirc;y dng, qun l&yacute; qu&aacute; tr&igrave;nh u t theo lut mi ban h&agrave;nh nh Lut u t, Lut u t c&ocirc;ng, Lut X&acirc;y dng, Lut Nh&agrave;  v&agrave; ci c&aacute;ch th tc h&agrave;nh ch&iacute;nh.</p>\r\n\r\n<p>B&ecirc;n cnh &oacute;, Cn Th tip tc x&acirc;y dng chng tr&igrave;nh ph&aacute;t trin &ocirc; th, k hoch h&oacute;a chng tr&igrave;nh ph&aacute;t trin &ocirc; th, tr&ecirc;n c s c&acirc;n i ngun lc, t&igrave;nh h&igrave;nh ph&aacute;t trin kinh t - x&atilde; hi ca TP  u t, c&aacute;c d &aacute;n h tng u mi, giao th&ocirc;ng.</p>\r\n\r\n<p>B trng Trnh &igrave;nh Dng cng cho bit, c s cho ph&eacute;p ca Th tng Ch&iacute;nh ph, trong thi gian ngn sp ti, B X&acirc;y dng s c&ugrave;ng vi Ng&acirc;n h&agrave;ng Th gii (WB) to ra mt trung t&acirc;m cp nc cho v&ugrave;ng, vi tng gi&aacute; tr khong 817 triu USD, t ti Cn Th.</p>\r\n\r\n<p>B X&acirc;y dng s c&ugrave;ng vi tnh Cn Th c&oacute; &yacute; kin thng nht v chng tr&igrave;nh u t ph&ugrave; hp, x&acirc;y dng mt &ocirc; th xanh, tit kim nng lng, th&acirc;n thin vi m&ocirc;i trng nhm ng ph&oacute; vi bin i kh&iacute; hu, chng ngp.</p>\r\n\r\n<p>B trng Trnh &igrave;nh Dng lu &yacute;: TP Cn Th thc hin i mi c&ocirc;ng t&aacute;c qun l&yacute; x&acirc;y dng, chu tr&aacute;ch nhim v sn phm ca ng&agrave;nh x&acirc;y dng, chuy&ecirc;n nghip trong qun l&yacute; u t x&acirc;y dng, l&agrave;m th tc nhanh, thanh to&aacute;n vn nhanh, m bo cht lng c&ocirc;ng tr&igrave;nh, l&agrave;m d &aacute;n nhanh, tht tho&aacute;t &iacute;t, kh&ocirc;ng tham nhng, nhng nhiu&hellip;</p>\r\n\r\n<p><strong>Tit kim hn 288 t ng ng&acirc;n s&aacute;ch</strong></p>\r\n\r\n<p>Theo b&aacute;o c&aacute;o ca UBND TP Cn Th, TP &atilde; trin khai Lut X&acirc;y dng vi mt s nhim v trng t&acirc;m nh th&agrave;nh lp Hi ng thm nh ch trng u t v&agrave; thm nh d &aacute;n u t c&aacute;c c&ocirc;ng tr&igrave;nh s dng vn ng&acirc;n s&aacute;ch nh&agrave; nc (NSNN); x&acirc;y dng quy ch l&agrave;m vic ca Hi ng thm nh ch trng u t v&agrave; thm nh d &aacute;n u t c&aacute;c c&ocirc;ng tr&igrave;nh s dng vn NSNN&hellip;</p>\r\n\r\n<p>C&ocirc;ng t&aacute;c kim tra, kim so&aacute;t cht lng c&ocirc;ng tr&igrave;nh x&acirc;y dng tip tc c tng cng, nht l&agrave; c&aacute;c d &aacute;n s dng vn NSNN. Vic thc hin tin kim thit k k thut v&agrave; d to&aacute;n c&aacute;c c&ocirc;ng tr&igrave;nh th&ocirc;ng qua thm tra thit k &atilde; i v&agrave;o n np. Cht lng thit k &atilde; c n&acirc;ng l&ecirc;n, &atilde; ct gim v&agrave; tit kim &aacute;ng k chi ph&iacute; cho ng&acirc;n s&aacute;ch, g&oacute;p phn ph&ograve;ng chng l&atilde;ng ph&iacute;, ph&ograve;ng nga sai phm, ri ro trc khi trin khai thi c&ocirc;ng x&acirc;y dng c&ocirc;ng tr&igrave;nh.</p>\r\n\r\n<p>Nm 2014, tng s c&ocirc;ng tr&igrave;nh do S qun l&yacute; chuy&ecirc;n ng&agrave;nh thm tra l&agrave; 222 c&ocirc;ng tr&igrave;nh s dng vn NSNN. Qua thm tra thit k, &atilde; ct gim, tit kim cho ng&acirc;n s&aacute;ch khong 288,7 t ng, khong 10,19%.</p>\r\n\r\n<p>Trong qu&yacute; I/2015, s c&ocirc;ng tr&igrave;nh thm tra l&agrave; 31 c&ocirc;ng tr&igrave;nh s dng vn NSNN, qua thm tra thit k &atilde; ct gim, tit kim cho NSNN khong 35 t ng, chim khong 11,35%.</p>\r\n\r\n<p>TP ang trin khai 08  &aacute;n quy hoch chuy&ecirc;n ng&agrave;nh h tng k thut nhm m bo h thng h tng k thut &ocirc; th c u t &uacute;ng hng, ng b.</p>\r\n\r\n<p><strong>Cn vn bn hng dn &aacute;p dng lut mi</strong></p>\r\n\r\n<p>Cng theo l&atilde;nh o TP Cn Th, thi gian qua, TP Cn Th gp rt nhiu kh&oacute; khn trong x l&yacute; cht thi rn, t la chn c&ocirc;ng ngh x l&yacute;, la chn nh&agrave; u t, quy m&ocirc; n t&igrave;m v tr&iacute; khu x l&yacute;, n gi&aacute; x l&yacute;&hellip;</p>\r\n\r\n<p>Tuy nhi&ecirc;n, c s quan t&acirc;m, h tr s&aacute;t sao ca B X&acirc;y dng, TP Cn Th tng bc khc phc kh&oacute; khn, vng mc v&agrave; ang u t x&acirc;y dng nh&agrave; m&aacute;y x l&yacute; cht thi rn bng c&ocirc;ng ngh t vi c&ocirc;ng sut d kin 500 tn/ng&agrave;y v&agrave;o cui th&aacute;ng 5/2015.</p>\r\n\r\n<p>Tin  thc hin c&aacute;c  &aacute;n quy hoch chuy&ecirc;n ng&agrave;nh h tng tr&ecirc;n a b&agrave;n TP c&ograve;n chm. Vic &aacute;p dng c&aacute;c lut mi ban h&agrave;nh nh Lut u t c&ocirc;ng, Lut u thu, Lut X&acirc;y dng c&ograve;n gp nhiu kh&oacute; khn do thiu c&aacute;c vn bn hng dn ca Trung ng.</p>\r\n\r\n<p>Chng tr&igrave;nh ph&aacute;t trin nh&agrave;  TP Cn Th n nm 2020, tm nh&igrave;n n nm 2030, d kin s ho&agrave;n th&agrave;nh v&agrave;o qu&yacute; II/2015. Trong &oacute;, nh&agrave;  cho ngi c&oacute; thu nhp thp ang c Cty Hng Loan trin khai vi tng mc u t 68,6 t ng, gm 288 cn h, &aacute;p ng ch  ca 1.000 ngi. D kin trong qu&yacute; II/2015, d &aacute;n s ho&agrave;n tt.</p>\r\n\r\n<p>Chng tr&igrave;nh nh&agrave;  cho c&ocirc;ng nh&acirc;n c&aacute;c khu c&ocirc;ng nghip d kin s c thc hin trong nm 2015-2016, sau khi c&oacute; &yacute; kin ch o ca B X&acirc;y dng.</p>\r\n\r\n<p>Chng tr&igrave;nh x&acirc;y dng khu nh&agrave;  sinh vi&ecirc;n &atilde; x&acirc;y xong v&agrave; a v&agrave;o s dng 04 d &aacute;n, vi tng s hn 900 ph&ograve;ng, &aacute;p ng ch  cho hn 7.300 sinh vi&ecirc;n.</p>\r\n\r\n<p>Chng tr&igrave;nh h tr nh&agrave;  cho h ngh&egrave;o, &atilde; x&acirc;y dng c hn 7.200 cn h, chim hn 60% tng s cn h cn x&acirc;y.</p>\r\n\r\n<p>Chng tr&igrave;nh nh&agrave;  cho cm tuyn d&acirc;n c v&ugrave;ng l &atilde; ho&agrave;n th&agrave;nh t&ocirc;n nn v&agrave; x&acirc;y dng h tng k thut thit yu cho tng s c 03 d &aacute;n.</p>\r\n\r\n<p>Chng tr&igrave;nh nh&agrave;  cho ngi c&oacute; c&ocirc;ng vi c&aacute;ch mng, &atilde; ho&agrave;n th&agrave;nh giai on I vi tng s hn 450 cn nh&agrave;, tng ng vi s tin hn 18 t ng.</p>\r\n\r\n<p><strong>Theo : B&aacute;o X&acirc;y dng in t.</strong></p>\r\n', '', '', '61065804.png', '61065804_120x80.png', 1, 1, 1432221134, 1444184967, 5, '', '', '', '', '', '', '', '', '', 'tin-tuc', 0),
