INSERT INTO `table_product_tab` (`id`, `id_photo`, `id_item`, `id_cat`, `photo`, `thumb`, `thumb1`, `ten`, `mota`, `stt`, `hienthi`, `com`, `ngaytao`, `ngaysua`, `vitri`, `link`, `noidung`) VALUES
(3, 620, 0, 0, '', '', '', 'Gii Thiu sn phm', '', 1, 1, 'product', 0, 0, 0, '', '<p style="text-align:justify"><strong>Th&ocirc;ng tin sn phm</strong></p>\r\n\r\n<p style="text-align:justify"> chi g Edugames &ograve;i hi ngi chi phi ph&aacute;t huy ti a kh nng s&aacute;ng to ca m&igrave;nh bi t&iacute;nh phong ph&uacute;, mi l v&agrave; hp dn trong c&aacute;ch chi. Kh&ocirc;ng ch k&iacute;ch th&iacute;ch tr&iacute; n&atilde;o,  chi c&ograve;n gi&uacute;p r&egrave;n luyn t&iacute;nh kh&eacute;o l&eacute;o, kh nng phi hp gia tay v&agrave; mt, tng kh nng tp trung v&agrave; thao t&aacute;c nhanh nhn.</p>\r\n\r\n<p style="text-align:justify">Kh&ocirc;ng ch c&oacute; nhiu m&agrave;u sc ni bt gi&uacute;p b&eacute; tha th&iacute;ch s&aacute;ng to v&agrave; ph&aacute;t trin th gi&aacute;c,  chi tranh gh&eacute;p c&ograve;n c l&agrave;m t cht liu an to&agrave;n. Do &oacute;, b&eacute; c&oacute; th thoi m&aacute;i tip x&uacute;c m&agrave; kh&ocirc;ng lo nh hng n sc khe.</p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify"><strong>Chi tit sn phm:</strong></p>\r\n\r\n<p style="text-align:justify">Tranh Gh&eacute;p 16 x 24 cm Edugames GB122 kh&ocirc;ng ch n thun l&agrave;  chi m&agrave; c&ograve;n l&agrave; c th gii ngh thut d&agrave;nh cho c&aacute;c b&eacute;. Vi nhiu tranh gh&eacute;p h&igrave;nh th&uacute; kh&aacute;c nhau b&eacute; s tha th&iacute;ch la chn cho m&igrave;nh loi ng vt y&ecirc;u th&iacute;ch sau &oacute; nh li c&aacute;c h&igrave;nh d&aacute;ng ca con vt y, t &oacute; b&eacute; s t duy d&ugrave;ng c&aacute;c mnh gh&eacute;p sao cho tr&ugrave;ng khp v&agrave; gh&eacute;p th&agrave;nh h&igrave;nh con vt ho&agrave;n chnh.</p>\r\n\r\n<p style="text-align:justify"> chi &ograve;i hi ngi chi phi ph&aacute;t huy ti a kh nng s&aacute;ng to ca m&igrave;nh bi t&iacute;nh phong ph&uacute;, mi l v&agrave; hp dn trong c&aacute;ch chi. Kh&ocirc;ng ch k&iacute;ch th&iacute;ch tr&iacute; n&atilde;o,  chi l&agrave;m t g c&ograve;n gi&uacute;p r&egrave;n luyn t&iacute;nh kh&eacute;o l&eacute;o, kh nng phi hp gia tay v&agrave; mt, tng kh nng tp trung v&agrave; thao t&aacute;c nhanh nhn.</p>\r\n\r\n<p style="text-align:justify">Mt trong nhng ti&ecirc;u ch&iacute; ch&iacute;nh ca  chi g mang li ch&iacute;nh l&agrave; kh nng gn kt mi th&agrave;nh vi&ecirc;n trong gia &igrave;nh. B m c&oacute; th chi c&ugrave;ng b&eacute;, trao i  gi&uacute;p tr s&aacute;ng to hn v&agrave; c bit l&agrave; gi&uacute;p c&aacute;c th&agrave;nh vi&ecirc;n trong nh&agrave; gn gi nhau hn.</p>\r\n\r\n<p style="text-align:justify">K&iacute;ch thc : 16 x 24 cm.</p>\r\n\r\n<p style="text-align:justify">Sn xut ti Vit Nam</p>\r\n');
