(1, 'Cng Ty in Lnh Hng Pht', '', 'Cng Ty in Lnh Hng Pht', '', '', '', 'Gii thiu chung', 'hop-qua-sac-hoa', 'Vi mong mun mi ngi c nhiu thi gian v d dng khi th hin tnh cm ca mnh Quatangtructuyen lun lm ht sc mnh  tit kim thi gian ca bn bng cch: Sp xp, chn lc sn phm trn website khoa hc, chuyn qu tng nhanh chng, thanh ton trc tip ti  nh trn ton quc. Tm nhn on-gift i din cho phong cch tng qu hon ton mi mang li hnh phc y  cho khch hng v ngi thn ca h. Lu li nhng khonh khc tuyt vi t k c, hin ti ti tng lai l s mnh khng ngng sng to ra phong cch tng qu th hin s quan tm chn thnh khng gii hn khong cch khng gian v thi gian.', '', '', '61821.jpg', '61821_290x230.jpg', 0, 1, 1225497589, 1339728897, '', '', '', '', '', '', 'Hp qu sc hoa', 'Hp qu sc hoa', 'Hp qu sc hoa', 'Hp qu sc hoa', '', '', 'gioi-thieu', 'https://www.youtube.com/watch?v=_O233zv8Wsc'),
(3, '', '', '', '', '', '', '', '', '<p>Hin ti Thy Thy Shop ang c chng trnh khuyn mi c bit "GIM GI 5% TT C SN PHM" khi t hng online. Quy trnh t hng v cng n gin, hy nhanh tay t hng  c gim ngay 5% nh!<br />\r\nBc 1: Chn sn phm cn mua<br />\r\nBc 2: Trong trang chi tit sn phm hin ra click vo nt " T MUA"<br />\r\nBc 3: Sau bc trn website s chuyn sang trang gi hng.  bc ny bn nhp cc thng tin cn thit theo yu cu<br />\r\nBc 4: Cp nht n hng thnh cng. Tip tc MUA SM hoc THANH TON<br />\r\nBc 5: Sau khi hon thnh bc 4 website s thng bo cho bn bit bn  t hng thnh cng v nhn vin ca shop s lin h li vi bn trong vng 15p k t khi nhn c n t hng.</p>\r\n', '<p>Hin ti Thy Thy Shop ang c chng trnh khuyn mi c bit "GIM GI 5% TT C SN PHM" khi t hng online. Quy trnh t hng v cng n gin, hy nhanh tay t hng  c gim ngay 5% nh!<br />\r\nBc 1: Chn sn phm cn mua<br />\r\nBc 2: Trong trang chi tit sn phm hin ra click vo nt &nbsp;" T MUA"<br />\r\nBc 3: Sau bc trn website s chuyn sang trang gi hng.  bc ny bn nhp cc thng tin cn thit theo yu cu<br />\r\nBc 4: Cp nht n hng thnh cng. Tip tc MUA SM hoc THANH TON<br />\r\nBc 5: &nbsp;Sau khi hon thnh bc 4 website s thng bo cho bn bit bn  t hng thnh cng v nhn vin ca shop s lin h li vi bn trong vng 15p k t khi nhn c n t hng.</p>\r\n', '', '64654.jpg', '64654_290x230.jpg', 1, 1, 0, 0, '', '', '', '', '', '', 'Hng dn thanh ton', 'Hng dn thanh ton', 'Hng dn thanh ton', 'Hng dn mua hng', '', '', 'huong-dan', ''),
(4, '', '', '', '', '', '', '', '', '', '<p><strong><span style="font-size:12pt">+&nbsp; Hnh thc thanh ton:</span></strong><br />\r\n<span style="font-size:12pt">&nbsp;&nbsp;</span><br />\r\n<span style="font-size:12pt">- Thanh ton tin mt khi nhn hng: ch p dng cho khu vc TP. HCM. (Tr Ngoi thnh HCM: Huyn Cn Gi, Hc Mn, Bnh Chnh, Nh B, C Chi, Qun 9, 12, Th c, Bnh Tn)</span><br />\r\n<br />\r\n<span style="font-size:12pt">- Chuyn khon ngn hng:&nbsp;p dng&nbsp;Ngoi thnh HCM v cc tnh thnh khc&nbsp;</span><br />\r\n<br />\r\n<span style="font-size:12pt">Ch&nbsp;ti khon:&nbsp;Cng ty TNHH Thng Mi Vistar</span><br />\r\n<br />\r\n<span style="font-size:12pt">Ngn hng Eximbank  Chi Nhnh Cng Ha - TP HCM</span></p>\r\n\r\n<div style="box-sizing: border-box; font-family: Arial, Roboto, sans-serif; margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-size: 14px; line-height: 21px;"><span style="font-size:12pt">S TK: 1404 1485 1028 671</span><br />\r\n<br />\r\n<strong><span style="font-size:12pt">+&nbsp; Cc ph vn chuyn:</span></strong><br />\r\n<span style="font-size:12pt">&nbsp;&nbsp;&nbsp;</span></div>\r\n\r\n<p><span style="font-size:12pt">- Khu vc TP.H Ch Minh:&nbsp;i vi n hng 500.000 ng tr ln, Vistar Pharmacy s giao hng&nbsp;min&nbsp;ph ti ni ch nh ca qu khch&nbsp;trong cc qun ni thnh TP.HCM, tr cc qun huyn sau: Huyn Cn Gi, Hc Mn, Bnh Chnh, Nh B, C Chi, Qun 9, 12, Th c, Bnh Tn</span></p>\r\n\r\n<p><br />\r\n<span style="font-size:12pt">- Tnh thnh khc:&nbsp;Cc ph vn chuyn c tnh ring theo tng n hng c th v s c cng chung vo gi tr hng ha v thng bo n qu khch  xc nhn. Qu khch c th xem biu gi cc tham kho ca Cng ty Chuyn pht nhanh.</span></p>\r\n\r\n<p><span style="font-size:12pt">&nbsp;&nbsp;&nbsp;</span><br />\r\n<strong><span style="font-size:12pt">+&nbsp; Thi gian giao hng:&nbsp;</span></strong></p>\r\n\r\n<p><span style="font-size:12pt">- Khu vc TP.H Ch Minh: sau khi qu khch t hng v nhn c email hoc in thoi xc nhn t hng thnh cng, trong vng 2-4 ngy, qu khch s nhn c hng ho, c th:</span></p>\r\n\r\n<div style="box-sizing: border-box; font-family: Arial, Roboto, sans-serif; margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-size: 14px; line-height: 21px;"><span style="font-size:12pt">Trong vng 48h sau khi t hng: Vistar Pharmacy xc nhn s lng tn hng ho</span></div>\r\n\r\n<div style="box-sizing: border-box; font-family: Arial, Roboto, sans-serif; margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-size: 14px; line-height: 21px;">&nbsp;</div>\r\n\r\n<div style="box-sizing: border-box; font-family: Arial, Roboto, sans-serif; margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-size: 14px; line-height: 21px;"><span style="font-size:12pt">Sau khi xc nhn thc hin n hng, trong vng 2-3 ngy Vistar Pharmacy s tin hnh giao hng&nbsp;</span></div>\r\n\r\n<p><span style="font-size:12pt">&nbsp;</span></p>\r\n\r\n<p><span style="font-size:12pt">- Tnh thnh khc:&nbsp;Sau khi nhn c thanh ton chuyn khon qua ngn hng, Vistar s tin hnh ng gi, d kin trong vng 2-3 ngy s bt u giao hng. Thi gian qu khch nhn hng ty thuc vo tnh thnh, qu khch c th tham kho thm D kin thi gian pht hng ca Cng Ty Chuyn Pht Nhanh.</span></p>\r\n\r\n<p><br />\r\n<span style="font-size:12pt">Lu : i vi khch hng  tnh,sau khi Vistar Pharmacy xc nhn s lng tn v ph vn chuyn th trong vng 7 ngy, qu khch phi chuyn tin vo ti khon cng ty TNHH Thng Mi Vistar.Nu qu thi gian trn, Vistar Pharmacy s tr hng li kho.</span></p>\r\n', '', '88978.png', '88978_290x230.png', 1, 1, 0, 0, '', '', '', '', '', '', 'Dch v thanh ton', 'Dch v thanh ton', 'Dch v thanh ton', 'Dch v thanh ton', '', '', 'thanh-toan', ''),
