(7, '', '', '', '', '', '', '', '', '', '<p><span style="color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px">Nu bn c thc mc hay vn  cn gii quyt hy nh rng B phn h tr khach hang lun sn sng gip  mi khi bn cn. V vy, ng do d m hy lin h vi chng ti thng qua hai cch sau y:</span><br />\r\n<br />\r\n<span style="color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px">1. Gi in thoi trc tip</span><br />\r\n<br />\r\n<span style="color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px">B phn h tr khach hang ca chng ti lun sn sng lng nghe v gii p cc vn  m khch hng gp phi. V vy, mi khi c thc mc, bn ng chn ch m hy gi ngay n s (08) 7300 2015  c gii p tn tnh.</span><br />\r\n<br />\r\n<span style="color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px">Thi gian phc v:</span><br />\r\n<br />\r\n<span style="color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px">Th 2 n Th 6: 7:00  18:00</span><br />\r\n<br />\r\n<span style="color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px">Th 7, CN &amp; L: 7:00  17:00</span><br />\r\n<br />\r\n<span style="color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px">2. Gi email ti hm th Vistar</span><br />\r\n<br />\r\n<span style="color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px">Chng ti mong mun gii p ton b thc mc ca khch hng t nh cho n ln. Nhng email m khch hng gi n hm th Vistar s c x l theo th t thi gian tip nhn v phn hi nhanh nht c th. Cho nn, hy gi ngay thc mc ca bn ti B phn h tr khach hang thng qua a ch email&nbsp;</span><a href="mailto:info@vistarpharmacy.com" style="box-sizing: border-box; font-family: Arial, Roboto, sans-serif; margin: 0px; padding: 0px; color: rgb(59, 175, 218); text-decoration: none; outline: none; font-size: 14px; line-height: 21px;">info@vistarpharmacy.com</a><span style="color:rgb(85, 85, 85); font-family:arial,roboto,sans-serif; font-size:14px">&nbs